    false,nt"url": null,nt"notes": "This annual narrative report for Yazoo
    National Wildlife Refuge outlines Refuge accomplishments during the 1982 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    research and investigations. Refuge administration is outlined; information about
    personnel, youth programs, manpower programs, funding, safety, and technical assistance
    is given. Habitat management is also covered; subjects include wetlands, forests,
    croplands, grasslands, haying, fire management, and pest control. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    animal control, and marking and banding. The public uses of the Refuge described
    in this report include hunting, wildlife observation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction
    and energy conservation. Cooperative programs are provided at the end.",nt"license_title":
